import logo1 from '../img/1.jpg'

const imgdata=[

    {
        id:1,
        link:logo1
    },
    {
        id:2,
        link:'../img/2.jpg'
    },
    {
        id:3,
        link:'../img/3.jpg'
    },
    {
        id:4,
        link:'../img/4.jpg'
    },
]


export default imgdata;
